import {
  SlogunSection,
  SlogunSmall,
  SlogunBig,
  PageHeader,
} from "./styledComponent";

function Slogun() {
  return (
    <div class="headerSlogun">
      <SlogunBig>Tilte </SlogunBig>
      <SlogunSmall>welcome!</SlogunSmall>
    </div>
  );
}

export default Slogun;
